var WAApiKey = ""

func TestForm1(t *testing.T) {

	req := types.RecordsRequest{
		Start:    time.Now().Unix(),
		End:      time.Now().Unix(),
		Cursor:   "",
		MinValue: 100,
		Limit:    5000000,
		Currency: "",
	}

	baseURL := "https://api.whale-alert.io"
	endpoint := "/v1/status"
	u, err := url.Parse(baseURL)
	if err != nil {
		fmt.Println(err)
		return
	}

	u.Path = endpoint

	query, err := encoder.Encode(req)
	if err != nil {
		fmt.Println(err)
		return
	}

	u.RawQuery = query.Encode()

	fmt.Println(u.String())

}

